import React from "react";

function Hero() {
  return (
    <div className="bg-cover bg-local text-basefont   " style={{ backgroundImage: `url(https://source.unsplash.com/1200x600?computer)`, opacity: "40%" }}>
      <div className="flex h-screen flex-col items-center pt-[12rem]">
        <p className="text-3xl font-bold  text-primary lg:text-6xl ">Growing Together</p>
        <h1 className="font-bold lg:p-2 lg:text-3xl">Grow With Data</h1>
        <div>
          <p className="font-bold ">Fast, Flexible and Great</p>
        </div>
      </div>
    </div>
  );
}

export default Hero;
